import React from 'react';
import HeaderBlock from './components/HeaderBlock';

const App = () => {
  return (
  <React.Fragment>
    <HeaderBlock 
      title="Учите слова онлайн"
      descr="Используйте карточки для запоминания и пополняйте активный словарный запас."/>
    <HeaderBlock 
      title="Нам нравится это"
      hideBackground
    />
  </React.Fragment>
  );
}
export default App;
